import React from 'react'
import styled from 'styled-components'
import Pin from './Pin'

function Mainboard(props) {

  let { pins } = props

  return (
    <Wrapper>
      <Container>
        {pins.map((pin, index) => {
          let { urls } = pin;
          return <Pin key={index} urls={urls} />
        })}

      </Container>

    </Wrapper>
  )
}

export default Mainboard

const Wrapper = styled.div`
  display: flex;
  justify-content: center;
  width: 100%;
  height: 100%;
  margin-top: 15px;
`; 

const Container = styled.div`
  display: flex;
  flex-wrap: wrap;
  align-items: center;
  justify-content: center;
  // column-count: 5;
  // column-gap: 5px;
  margin: 0 auto;
  height: 100%;
  max-width: 1260px;
  background-color: white;
`
